import './footer.scss';
import urbanbinlogo from '../../assets/urbanbin-logo-simple.svg'

const Footer = () => {
    return (
        <div className='footer'>
            <div className='footer-logo'>
                <img src={urbanbinlogo} />
            </div>
            <div className='footer-content'>
                <span>Home</span>
                <span>Company</span>
            </div>

        </div>
    )
}

export default Footer;
